import Link from 'next/link';
import classNames from 'classnames';
import { Container, List, Image } from '../styles/NavBar';

const NavBar = ({ classes, children, ...restProps }) => {
    return(
        <Container className={classNames('navbar', classes)} {...restProps}>
            <nav>
                <NavBar.List>
                    <li className="nav-item">
                        <Link href="/">
                            <a id="logo">
                                <img className="w-32" src="/images/SpaceX-Logo.svg" />
                                <CardLaunch.Image src={getImage(launch.links.flickr_images)} alt={launch.mission_name}/> 
                            </a>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link href="/about">
                            <a className="py-2 flex items-center text-xs uppercase font-bold font-poppins text-white hover:opacity-75">About</a>
                        </Link>
                    </li>
                </NavBar.List>
            </nav>
        </Container>
    )
}

NavBar.List = function NavList({ classes, children, ...restProps}) {
    return (
        <List className={classNames('nav__list', classes)} {...restProps}>
            {children}
        </List>
    )
}

NavBar.Image = function NavImage({ src, alt, classes, ...restProps}) {
    return (
        <Image 
        src={src}
        alt={alt}
        className={classNames('nav__image'), classes}
        {...restProps}
        />
    )
}

export default NavBar;
